import React from 'react';
import { Link } from 'react-router-dom';

const ClientLi = ({ client }) => {
  console.log(client)
  return (
    <Link to={{ pathname: `/client/${client.clientId}`, state: client}}>
      <li>{ client.name }</li>
    </Link>
  )
}

export default ClientLi;
